For sale: Springfield XDm 5.25 9mm. The gun has a Powder River Precisions drop in trigger, Don’s Stainless Steel Guide Rod. .375 and.250 slam pads, Wolff 14lbs recoil spring and factory recoil spring, Ready Tactical IDPA holster and Pistol Gear “Operator” Magwell. The gun has a few hundred rounds through it. It also comes with all the factory XDm stuff which includes: the case, mag holster, gun holster, replaceable back-straps, and three 19rd magazines. It’s one of the best shooting polymer guns I’ve ever shot. Here are some links for all the aftermarket parts on the gun.

